 b-- {
					if cm.Content[b] == '\n' {
						n -= 1
					}
					if n == 0 {
						cm.Content = cm.Content[:b]
						break
					}
				}
				if n > 0 {
					// Should be impossible.
					log.Panicf(""Failed to find enough newlines when truncating Content, %d left over, %d ranges"", n, len(cm.Ranges))
				}
			}

			cm.Ranges = cm.Ranges[:limit]
			if cm.SymbolInfo != nil {
